import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container} from "react-bootstrap";
import CountryBox from "./component/CountryBox";
import InitData from "./component/InitData";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import React from "react";

// import {FloatingLabel} from "react-bootstrap";


function App() {

    const selected = {
        "countries":()=>{alert(3);},
        "ini":()=>{alert(2);}
    }


    function onTabClick(update){
        alert(1);
        // update();
    }

    return (
        <Tabs
            defaultActiveKey="countries"
            id="fill-tab-example"
            className="mb-0 border-primary"
            fill
            onSelect={(k)=>{
               selected[k]();
            }}
        >
            <Tab eventKey="countries" title="Countries"
                 >
                <div className="App">
                    <header className="App-header">
                    </header>
                    <main>
                        <Container xs={5}>
                            <CountryBox/>
                        </Container>
                    </main>
                </div>
            </Tab>
            <Tab eventKey="ini" title="Initialize Data">
                <InitData/>
            </Tab>
        </Tabs>
    )
        ;
}

export default App;
